import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <section className="home-section">
      <h2>Accueil</h2>
      <p>
        Bienvenue sur notre plateforme de modération de messages en temps réel. Notre objectif est de vous fournir un
        environnement sûr et convivial pour communiquer de manière approprié.
      </p>
      <p>
        Utilisez le chatbot ci-dessous pour interagir avec notre système et obtenir de l'aide en
        temps réel.
      </p>
    </section>
  );
};

export default Home;
